import React, { useState, useEffect } from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { Button } from "@mui/material";
import AlertDialog from "./Dialog";

const rows = [
  {
    id: 1,
    date: "01/12/23",
    description: "Supermecado Dona Novinha",
    total: 234.0,
    items: [{ nome: "test", qtd: 2, value: 12, total: 24 }],
  },
];
const header = ["Data", "Descrição", "Total", "Item"];

export default function TableComponent() {
  const [open, setOpen] = useState(false);
  const [items, setItems]= useState([])

  const handleClickOpen = (row) => {
    setOpen(true);
    setItems(row)
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: "90vw" }}>
          <TableHead>
            <TableRow>
              {header.map((item) => (
                <TableCell align="right">{item}</TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow key={row.id}>
                <TableCell align="right">{row.date}</TableCell>
                <TableCell align="right">{row.description}</TableCell>
                <TableCell align="right">{row.total}</TableCell>
                <TableCell align="right">
                  <Button variant="outlined" onClick={() => handleClickOpen(row)}>
                    Visualizar
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <AlertDialog open={open} handleClose={handleClose} items={items}/>
    </>
  );
}
